import React from 'react';
import ReturnRegion from './Region';
import { auth } from '../../firebase';
import { useNavigate } from 'react-router-dom';
import { gsap, Expo } from 'gsap';

// View Region
export default function Region() {

 const navigation = useNavigate();
 const user = auth.currentUser;

 React.useEffect(() => {
  user != null ? window.console.log(true) : navigation('/');

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', .1, { delay: 1.2, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 100);

 }, []);

 return (
  <ReturnRegion />
 );
};
